import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import {Link } from "react-router-dom"

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing(3),
  },
}));

export default function PermanentDrawerLeft() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar position="fixed" className={classes.appBar}>
        <Toolbar>
          <Typography variant="h6" noWrap>

          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        className={classes.drawer}
        variant="permanent"
        classes={{
          paper: classes.drawerPaper,
        }}
        anchor="left"
      >
        <div className={classes.toolbar} />
        <Divider />
        <Link exact to = "/MainPage">
        <List >
          {['籃球介紹'].map((text, index) => (
            <ListItem button key={text}>
              {/* <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        </Link>
        <Link exact to = "/BasketballVideo">
        <List >
          {['籃球影片'].map((text, index) => (
            <ListItem button key={text}>
              {/* <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        </Link>
        <Divider />
        <Link exact to = "/Volleyball">
        <List >
          {['排球介紹'].map((text, index) => (
            <ListItem button key={text}>
              {/* <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        </Link>
        <Link exact to = "/VolleyballVideo">
        <List >
          {['排球影片'].map((text, index) => (
            <ListItem button key={text}>
              {/* <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        </Link>
        <Divider />
        <List>
          {['個人資料'].map((text, index) => (
            <ListItem button key={text}>
              {/* <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        <Link exact to = "/">
        <List >
          {['登出'].map((text, index) => (
            <ListItem button key={text}>
              {/* <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        </Link>
      </Drawer>
      <main className={classes.content}>
        <div className={classes.toolbar} />
        <Typography paragraph>

        </Typography>
        <Typography paragraph>
        位置介紹：
        <Typography/>
        1.控球後衛（Point Guard；簡稱PG）：又叫組織後衛，是籃球比賽陣容中的一個固定位置。控球後衛往往是全隊進攻的組織者，並且具備了一定水準的進攻能力，通過對球的控制來決定在恰當的時間傳球給適合的球員。例如:Stephen Curry
        <Typography/>
        2.得分後衛（ Shooting Guard；簡稱SG）：
            一般擔任該位置的球員身高和體格都低於前鋒球員，但在速度上具有優勢。他們往往是比賽中最好的跳投手，但往往也能切入上籃。例如:Denny Green 
        <Typography/>  
        3.小前鋒（Small Forward；簡稱SF）：
            傳統上以進攻得分為主要任務，強調快速推進上籃的能力。隨著各種半場進攻戰術以及三分線的發展，現今籃壇的小前鋒除了速度以外，往往還被要求具備運球突破以及長距離投射的能力。由於強調速度多於強調力量，小前鋒通常較大前鋒靈活，而體格不如大前鋒壯碩。
            例如 :Leborn James
        <Typography/>  
        4.大前鋒（ Power Forward；簡稱PF）
            一個典型的大前鋒是球場上體格較壯，而仍具備一定速度的球員。傳統上，大前鋒被要求利用他們壯碩的體型，在籃下積極強攻並爭奪進攻籃板球，並輔佐中鋒在禁區的防守。 例如：Draymond Green PS: 可惜他沒獲獎，他那麼強悍ＱＱ
        <Typography/>
        5.中鋒（ Center ；簡稱C）：
            一般都由隊中最高的球員擔任，傳統上強調籃下的防守，以及防守籃板球的保護。由於具有身高的優勢，一些具備進攻天份的中鋒球員也常常成為在禁區附近投籃得分的主要進攻點。例如：

        </Typography>
      </main>
    </div>
  );
}
